// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract LandRegistry {
    struct Land {
        string location;
        uint256 size;
        address owner;
        string documentHash;
        bool exists; // Track if the land is already registered
    }

    mapping(uint256 => Land) public lands;
    uint256 public landCount;

    event LandRegistered(uint256 indexed landId, string location, uint256 size, address indexed owner, string documentHash);
    event LandTransferred(uint256 indexed landId, address indexed oldOwner, address indexed newOwner);

    // Modifier to check if the caller is the owner of the land
    modifier onlyOwner(uint256 _landId) {
        require(msg.sender == lands[_landId].owner, "Only the owner can perform this action");
        _;
    }

    // Register a new land in the system
    function registerLand(string memory _location, uint256 _size, string memory _documentHash) public {
        require(bytes(_location).length > 0, "Location is required");
        require(_size > 0, "Size must be greater than zero");
        require(bytes(_documentHash).length > 0, "Document hash is required");

        // Check for duplicate document hash
        for (uint256 i = 0; i < landCount; i++) {
            require(keccak256(abi.encodePacked(lands[i].documentHash)) != keccak256(abi.encodePacked(_documentHash)), "This land is already registered");
        }

        lands[landCount] = Land(_location, _size, msg.sender, _documentHash, true); // Mark the land as existing
        emit LandRegistered(landCount, _location, _size, msg.sender, _documentHash);
        landCount++;
    }

    // Transfer land ownership to a new owner
    function transferLand(uint256 _landId, address _newOwner) public onlyOwner(_landId) {
        require(_landId < landCount, "Land ID is invalid");
        require(_newOwner != address(0), "New owner address is required");

        address oldOwner = lands[_landId].owner;
        lands[_landId].owner = _newOwner;

        emit LandTransferred(_landId, oldOwner, _newOwner);
    }

    // View all registered lands
    function getAllLands() public view returns (Land[] memory) {
        Land[] memory allLands = new Land[](landCount);

        for (uint256 i = 0; i < landCount; i++) {
            Land storage land = lands[i];
            allLands[i] = land;
        }

        return allLands;
    }
}
